import React, { useEffect, useState } from 'react';

const Orders = () => {
  const [orders, setOrders] = useState<any>(null);

  useEffect(() => {
    fetch('http://192.168.1.107:8000/api/orders')
      .then(res => res.json())
      .then(setOrders);
  }, []);

  return (
    <section>
      <h2>Orders</h2>
      <pre>{JSON.stringify(orders, null, 2)}</pre>
    </section>
  );
};

export default Orders;
